import './App.css';
import { createTheme, ThemeProvider } from '@material-ui/core/styles';
import NavBar from './components/navBar';
import HomeSlider from './components/HomeSlider';

const theme = createTheme({
  palette: {
    primary: {
      main: "#141414"
    },
    secondary: {
      main: "#f1f0ec"
    }
  },
});

function App() {
  return (
    <div className="App">
      <ThemeProvider theme={theme}>
        <NavBar/>
        <HomeSlider/>
      </ThemeProvider>
    </div>
  );
}

export default App;
